import s from './s.module.scss';
import avatar from './avatar.png';

export const Header = () => {
    return (
        <div className={s.header}>
            <div className={s.city}>
                <div>Самара</div>
            </div>
            <div className={s.userInfo}>
                <img
                className={s.avatar}
                src={avatar}
                alt="avatar"
                />
                <div>Василий</div>
            </div>
        </div>
    );
  };
